import React from "react";
import { Bar } from "react-chartjs-2";

import {
    Chart,
    BarElement,
    BarController,
    Decimation,
    Filler,
    Legend,
    Title,
    Tooltip,
    SubTitle
  } from 'chart.js';
  
  Chart.register(
    BarElement,
    BarController,
    Decimation,
    Filler,
    Legend,
    Title,
    Tooltip,
    SubTitle
  );


const data_graph = fetch('/api/datos').then(res => res.json()).catch(err => console.log(err));

const datos = [0,1,2,3,4,5,6]
const labels = [0,1,2,3,4,5,6]
const options = {
    fill: true,
    responsive: true
}



function GetData() {
    const data = {
        datasets : [
            {
                label: "datos",
                data: datos
            },
        ],
        labels,
    };

    return (
        <div className="grafico">
            <Bar data={data} options={options} />
        </div>
    )
}

export default GetData;
